    <script>
      function ChangeClass(id) {
        $(id).removeClass('activar2')
        $(id).toggleClass('activar')
        $(id).removeAttr('onclick')
        $(id).on('click', function (e) {
          //console.log($(e.target.parentNode));
          Reversa(e)
        })
      }
      function Reversa(e) {
        $(e.target.parentNode).on('click', function (e) {
          ChangeClass($(e))
        })
        $(e.target.parentNode).toggleClass('active')
      }
      function RemoveClassCurrent(d) {
        $('.nav.nav-second-level.collapse.in .active').removeClass('active')
        $(d).addClass('active')
      }
      function RemoveClassActivo() {
        $('.Activo').removeClass('Activo')
      }
    </script>
